  @override
  void initState() {
    super.initState();
    filteredMovies = []; // Ensure no movies are shown initially
  }

  void updateSearch(String input) {
    setState(() {
      query = input;
      if (query.isEmpty) {
        filteredMovies = []; // Clear the list when query is empty
      } else {
        filteredMovies = movies
            .where((movie) => movie['title'].toString().toLowerCase().contains(
                  query.toLowerCase(),
                ))
            .toList();
      }
    });
  }

